import { Box } from "@mui/material";
import React from "react";

export default class Footer extends React.Component {
  public render(): JSX.Element {
    return (
      <Box
        sx={{
          width: "100%",
          height: 50,
          backgroundColor: "secondary",
          "&:hover": {
            backgroundColor: "primary.main",
            opacity: [0.9, 0.8, 0.7],
          },
        }}
      />
    );
  }
}
